import React from "react";

const Test = () => {
    return (
        <div
            class="main"
            style="
    position: fixed;
    top: 0;
    left: 0;
    bottom: 0;
    right: 0;
    background: rgba(0, 0, 0, .5);
"
        >
            <div
                class="loading2"
                style="
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    width: 40px;
    height: 40px;
"
            >
                <div
                    class="up"
                    style="
   width: 100%;
    height: 100%;
    border-style: solid;
    border-color: transparent transparent red transparent;
    border-width: 2px;
    position: absolute;
    border-radius: 999px;
"
                ></div>
                <div
                    class="bottom"
                    style="
    width: 100%;
    height: 100%;
    border-style: solid;
    border-color: red transparent transparent transparent;
    border-width: 2px;
    position: absolute;
    border-radius: 999px;
"
                ></div>
            </div>
        </div>
    );
};

export default Test;
